import React from 'react'
import { ReactCompareSlider, ReactCompareSliderImage } from 'react-compare-slider';
import imageOne from '../../../assets/nonUpscaledImage.jpg'
import imageTwo from '../../../assets/upscaledImage.jpg'

const UpscaleMarketingSlide = ({category}) => {
  
  return (
    <div>
      <ReactCompareSlider
        itemOne={<ReactCompareSliderImage src={imageOne} alt={`${category}-NonUpscaledPhoto`} className='lg:min-w-[1200px] w-full' />}
        itemTwo={<ReactCompareSliderImage src={imageTwo} alt={`${category}-UpscaledPhoto`} className='lg:min-w-[1200px] w-full' />}
        style={{
          height: '500px',
          backgroundPosition: 'center center',
        }}
        className='lg:rounded-xl'
        boundsPadding={120}
      />
    </div>
  )
}

export default UpscaleMarketingSlide
